  false,\n\t\"url\": null,\n\t\"notes\": \"This report evaluates existing fisheries
  of the Kenai Peninsula and is broken down in two section, values associated with
  commercial fishery resources and value of the sport fishery. It has not been prepared
  to determine or compare the relative value of sport or commercial fisheries, but
  rather the comprehensive values of all fisheries if order that these resources may
  be adequately considered during the course of various hydro-electric, industrial
  and land-use development programs, and their more specific impact upon such resources.\",\n\t\"owner_org\":
